import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import CreateUserForm from './components/CreateUserForm';
import LoginForm from './components/LoginForm';
import PasswordResetRequestForm from './components/PasswordResetRequestForm';
import SetNewPasswordForm from './components/SetNewPasswordForm';

function App() {
    return (
        <Router>
            <div className="App">
                <div className="container">
                    <h1 className="my-4">Gym Management System</h1>
                    <nav>
                        <ul className="nav">
                            <li className="nav-item">
                                <Link className="nav-link" to="/create-user">Create User</Link>
                            </li>
                            <li className="nav-item">
                                <Link className="nav-link" to="/login">Login</Link>
                            </li>
                            <li className="nav-item">
                                <Link className="nav-link" to="/password-reset-request">Password Reset Request</Link>
                            </li>
                            <li className="nav-item">
                                <Link className="nav-link" to="/set-new-password">Set New Password</Link>
                            </li>
                        </ul>
                    </nav>
                    <Routes>
                        <Route path="/create-user" element={<CreateUserForm />} />
                        <Route path="/login" element={<LoginForm />} />
                        <Route path="/password-reset-request" element={<PasswordResetRequestForm />} />
                        <Route path="/set-new-password" element={<SetNewPasswordForm />} />
                    </Routes>
                </div>
            </div>
        </Router>
    );
}

export default App;
